import React, { useState, useEffect } from 'react';

import './App.css';

import {
  getSomething
  //getLinks
  //createTags
  //getTags
  //countClicks
} from '../api';

/*
import {
  App,
  form
} from './components';
*/

const App = () => {
    return (
      <div>
        <header>
          <h1>The Great Linkerator</h1>
          <h2>Bookmark your favorite pages</h2>
        </header>
        <main>
          <div id="link">

            <form>
            <h3>enter a link:</h3>
              <input type="text" placeholder="https.example.com"></input>
            </form>
          </div>

          <div id="comment">
            <h3>enter your comment:</h3>
            <form>
              <input type="text" placeholder="This site is the best!"></input>
            </form>
          </div>

          <div id="tag">
            <h3>enter a tag:</h3>
            <form>
              <input type="text" placeholder="ex. news, helpful, etc."></input>
            </form>
          </div>
        </main>
      </div>
    )
  }


export default App;
